using SeedAnyAuth;

var client = new SeedAnyAuthClient("TOKEN");
await client.Auth.GetTokenAsync(
    new GetTokenRequest
    {
        ClientId = "client_id",
        ClientSecret = "client_secret",
        Audience = "https://api.example.com",
        GrantType = GrantType.AuthorizationCode,
        Scope = "scope",
    }
);

